  return (
    <div className={styles.app}>
        <header className={clsx(styles.header, 'pt-4','pb-4')}>
            <div>
                <div>
                    <ul>
                        <li>
                            <BurgerIcon type="primary" />
                            <a>Конструктор</a>
                        </li>
                        <li>
                            <a>Лента заказов</a>
                        </li>
                    </ul>
                </div>
                <div>
                    <Logo />
                </div>
                <div>

                </div>
            </div>
        </header>
    </div>
  );
}

export default App;
